import '../Assets/Styles/Content.css';

import locationImg from '../Assets/Images/location.png';
import temperatureImg from '../Assets/Images/temperature.png';

function Content() {
    const [sourcesMetrics, setSourcesMetrics] = useState({});

    useEffect(() => {
        
    });

    getCleanTechMetrics = async () => {
        var response = await fetch('http://localhost:5281/CleanTechProxy/metrics', { method: 'get' });
    
        var responsejson = await response.json();
        this.setState({ cleanTechMetrics: responsejson })
    }

    return(
        <div className='dashboard__content'>
            <div className='dashboard__element'>
                <div className='element__header'>
                    <div className='name'>
                        Windmill Riga_15
                    </div>
                    <div className='location'>
                        <img className='locationImage' src={locationImg} alt='Loc'/>
                        Riga
                    </div>
                </div>

                <div className='element__metrics'>
                    <div className='element__mainMetric'>
                        150 W
                    </div>
                    <div className='element__additionMetric'>
                        <img className='temperatureImage' src={temperatureImg} alt='Tmp'/>
                        +15 C
                    </div>
                </div>

            </div>
            <div className='dashboard__element'></div>
        </div>
    );
}

export default Content;
